import React from 'react';
import Heading from './Heading';
import Note from './Note';
import Footer from './Footer';
import notes from '../notes.js';

function App() {
	return (
		<div>
			<Heading />
			{notes.map((noteItem) => {
				return <Note key={noteItem.key} title={noteItem.title} content={noteItem.content} />;
			})}
			<Footer />
		</div>
	);
}

export default App;
